import img1 from '../Images/img1.png';
import img2 from '../Images/img2.png';
import img3 from '../Images/img3.png';
import img4 from '../Images/img4.png';
import img5 from '../Images/img5.png';
import img6 from '../Images/img6.png';
import img7 from '../Images/img7.png';
import img8 from '../Images/img8.png';
import img9 from '../Images/img9.png';
import img10 from '../Images/img10.png';
import img11 from '../Images/img11.png';
import img12 from '../Images/img13.png';

function Partner()
{
    return(
        <div className="partner">
            <h1 className="partner-head">TRUSTED BY OUR PARTNER'S</h1>
            <div className="brand">
                <div className="card-brand">
                    <img src={img1} className="card-img"/> 
                </div>

                <div className="card-brand">
                    <img src={img2} className="card-img"/> 
                </div>

                <div className="card-brand">
                    <img src={img3} className="card-img"/> 
                </div>

                <div className="card-brand">
                    <img src={img4} className="card-img"/> 
                </div>

                <div className="card-brand">
                    <img src={img5} className="card-img"/> 
                </div>

                <div className="card-brand">
                    <img src={img6} className="card-img"/> 
                </div>

                <div className="card-brand">
                    <img src={img7} className="card-img"/> 
                </div>

                <div className="card-brand">
                    <img src={img8} className="card-img"/> 
                </div>

                <div className="card-brand">
                    <img src={img9} className="card-img"/> 
                </div>

                <div className="card-brand">
                    <img src={img10} className="card-img"/> 
                </div>

                <div className="card-brand">
                    <img src={img7} className="card-img"/> 
                </div>

                <div className="card-brand">
                    <img src={img7} className="card-img"/> 
                </div>
            </div>
        </div>
    );
}

export default Partner;
